Aleska Diamond - Our exchange student was wanting to learn everything American.
Added: July 15, 2010
Searching the community college for new students, we saw Aleska sitting out front of the English department. Coming from Russia to learn English, Aleska wanted to learn everything American. We told her about our special club, and she wanted into our exclusive club!
